  [],\n\t\"revision_timestamp\": \"2015-05-07T15:24:28.523538\",\n\t\"name\": \"metabolic-cost-approach-to-characterizing-advanced-spacesuit-mobility-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rntSpacesuit mobility has been
  historically difficult to define and therefore, difficult to write requirements
  for.&amp;nbsp; Most previous efforts have concentrated on establishing metrics for
  isolated joints &amp;ndash; often multiple movements for each joint &amp;ndash;
  and characterizing the range of motion of that joint &amp;ndash; as well as the
  corresponding joint torque through said range of motion.&amp;nbsp; However, there
  have been multiple issues with this approach:&amp;nbsp; First, it has been shown
  through multiple tests at JSC that joint torque data lacks repeatability, even with
  the same test setup and subject; Second, a suit can often meet defined mobility
  requirements yet exhibit lackluster or anomalous mobility behavior (or vice versa);
  Third, defining mobility at the isolated joint level does not capture the mobility
  of the comprehensive suit system in real application, with multiple joints often
  working in harmony or in discord.&amp;nbsp; Lastly, there lacks a standardized testing
  protocol with which JSC and suit contractors can assess suited mobility in a repeatable
  and predictable manner.&amp;nbsp; The proposal contained herein aims to mitigate
  all of these problems through investigating a new method of suited mobility characterization:
  by measuring the relative metabolic cost associated with performing a series of
  functional tasks as compared to performing those same tasks in a shirtsleeve environment.&lt;/p&gt;rn\",\n\t\"license_title\":
